import LevelBuilderfrom sprites import *def render(name,bg):	lb = LevelBuilder.LevelBuilder(name+".plist",background=bg)	lb.addObject(Hero.HeroSprite(x=249, y=274,width=32,height=32))	lb.addObject(Nut.NutSprite(x=211, y=216,width=14,height=14,restitution=0.2,static='false',friction=0.5,density=20 ))	lb.addObject(Enemy.EnemySprite(x=278, y=216,width=32,height=32,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ))	lb.addObject(Bomb.BombSprite(x=173, y=274,width=32,height=32 ,restitution=0.2,static='false',friction=0.5,density=20 ))	lb.addObject(SpikeyBuddy.SpikeyBuddySprite(x=173, y=150,width=40,height=40,restitution=0.2,static='false',friction=0.5,density=20 ))	lb.addObject(Friend.FriendSprite(x=139, y=216,width=32,height=32,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ))	lb.addObject(Star.StarSprite(x=249, y=150,width=32,height=32))	lb.addObject(Beam.BeamSprite(x=60, y=44,width=166,height=119,angle='-9',restitution=0.2,static='true',friction=0.5,density=20 ).setName('Beam'))	lb.addObject(Beam.BeamSprite(x=221, y=44,width=166,height=119,angle='-9',restitution=0.2,static='true',friction=0.5,density=20 ).setName('Beam'))	lb.addObject(Beam.BeamSprite(x=371, y=38,width=166,height=119,angle='21',restitution=0.2,static='true',friction=0.5,density=20 ).setName('Beam'))	lb.addObject(Beam.BeamSprite(x=487, y=105,width=166,height=221,angle='21',restitution=0.2,static='true',friction=0.5,density=20 ).setName('Beam'))	lb.addObject(Joints.DistanceJoint(body1='Nut',body2='Hero',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='Nut',body2='Enemy',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='Nut',body2='Star',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='Nut',body2='SpikeyBuddy',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='Nut',body2='Friend',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='Nut',body2='Bomb',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='Enemy',body2='Hero',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='Enemy',body2='Star',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='SpikeyBuddy',body2='Star',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='SpikeyBuddy',body2='Friend',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='Bomb',body2='Friend',damping='0.2',freq='2' ))	lb.addObject(Joints.DistanceJoint(body1='Bomb',body2='Hero',damping='0.2',freq='2' ))	lb.render()